import React, { useContext } from "react";
import LeftContentStyle from "./LeftContentStyle"

import LeftList from "./LeftList/LeftList"
import LeftListActive from "./LeftListActive/LeftListActive"

import  {ListActive} from "../../../Global"

class LeftContent extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
        };
      }




      render() {
        return (
            <LeftContentStyle>
                <LeftList _setActiveList={this._setActiveList}/>
                <LeftListActive ListActive={ListActive}/>
            </LeftContentStyle>
        )
      }
}


export default LeftContent;
